// part 2: keep track of the lyft
const matchLyftAndDriver = () => {
    _lyftHeaps.forEach((_lyftHeap, index) => {
        let closestLyft = _lyftHeap.top();
        while (closestLyft != null && closestLyft.pickupTime <= currentTime + pairingTimeThreshold) {
            // difference within a minute
            if (isDelayed(lyftDelayProbability) && !(closestLyft.alreadyLate)) {
                lyftsLate += 1;
                let lateMinutes = Math.random()*lyftDelayAmount;
                totalLyftLateMinutes += lateMinutes;
                let lateLyft = _lyftHeap.pop();
                lateLyft.pickupTime += lateMinutes;
                lateLyft.alreadyLate = true;
                _lyftHeap.push(lateLyft);
                continue;
            }
            if (_flyerLyftDispatchedHeaps[index].top().pickupTime <= closestLyft.pickupTime + lyftWaitThreshold * 60) {
                // partnered up
                _flyerLyftDispatchedHeaps[index].pop();
                _lyftHeap.pop();
                onLyftCounter += 1;
            }
            else {
                if (currentTime < closestLyft.pickupTime && !(closestLyft["alreadyWaited"])) {
                    flyerTooSlowCounter += 1;
                    closestLyft["alreadyWaited"] = true;                    
                }
                break;
            }
            closestLyft = _lyftHeap.top();
        }
    });
    _flyerLyftDispatchedHeaps.forEach((_flyerLyftDispatchedHeap, index) => {
        let closestFlyer = _flyerLyftDispatchedHeap.top();
        if (closestFlyer != null && _lyftHeaps[index].top().pickupTime > closestFlyer.pickupTime + (1 + flyerWaitThreshold) * 60) {
            lyftTooSlowCounter += 1;
        }
    });
}

// from https://stackoverflow.com/questions/25227119/javascript-strings-format-is-not-defined
String.prototype.format = function () {
    var args = [].slice.call(arguments);
    return this.replace(/(\{\d+\})/g, function (a){
        return args[+(a.substr(1,a.length-2))||0];
    });
};

var arr_flyer = [];
var arr_lyft = [];
// this function gets called every 10 seconds or so
const mainloop = (lyftModule, timeData) => {
    let topFlight = _flightHeap.top();
    while(topFlight != null && topFlight.arrivalTime < currentTime) {
        add_customers_for_lyftoff(_flightHeap.pop())
        topFlight = _flightHeap.top();
    }
    dispatchLyft(lyftModule, timeData);
    matchLyftAndDriver();
    var minutes = String(Math.floor(currentTime%3600/60));
    if (minutes.length == 1) minutes = "0" + minutes;
    arr_flyer.push(JSON.parse(JSON.stringify(_globalFlyerList)));
    arr_lyft.push(JSON.parse(JSON.stringify(_globalLyftList)));
    console.log("{0}:{1}: {2} flyers deplaned, {3} dispatched Lyfts, {4} flyers running {9} mins late on average, {5} Lyfts running {10} mins late on average, {6} got on a Lyft, {7} flyers waiting more than {11} minute(s), {8} Lyfts waiting more than {12} minute(s)".format(Math.floor(currentTime/3600), minutes, String(_flyerHeap.len), String(_lyftHeaps[1].len + _lyftHeaps[2].len), String(flyersLate), String(lyftsLate), String(onLyftCounter), String(lyftTooSlowCounter), String(flyerTooSlowCounter), String(Math.floor(totalFlyerLateMinutes/flyersLate/60)), String(Math.floor(totalLyftLateMinutes/lyftsLate/60)), String(flyerWaitThreshold), String(lyftWaitThreshold)));
    setTimeout(() => {
        currentTime += timeInterval;
        if (currentTime > demoBaseTime + 150*60) {
            var fs = require('fs');
            fs.writeFile("/users/matthew/desktop/arr_flyer.txt", JSON.stringify(arr_flyer), function(err) {
                if(err) {
                    return console.log(err);
                }
            
                console.log("The file was saved!");
            }); 
            fs.writeFile("/users/matthew/desktop/arr_lyft.txt", JSON.stringify(arr_lyft), function(err) {
                if(err) {
                    return console.log(err);
                }
            
                console.log("The file was saved!");
            }); 

            return;
        }
        mainloop(lyftModule, timeData);}, pollFrequency);
}

const main = () => {
    flights.forEach((flight) => {
        _flightHeap.push(flight);
        return;
    })
    LyftModuleAtlSouth();
}

main();

